
public class Switch2 {

	public static void main(String[] args) {
		// TODO Auto-generated method stub
		
		int num = 10;
		
		switch(num)
		{
		case 5:
			System.out.println("5");
			break;
			
		case 10:
			System.out.println("10");
			break;
			
		case 15:
			System.out.println("15");
			break;
			
		default:
			System.out.println("Default");
			
		}
		

	}

}
